dy-sub {\r\n        margin-top: 25px;\r\n        padding-top: 25px;\r\n        border-top: 1px solid #EAEAEC\r\n    }\r\n\r\n    .content-cell {\r\n        padding: 35px\r\n    }\r\n\r\n    @media only screen and (max-width: 600px) {\r\n        .email-body_inner, .email-footer {\r\n            width: 100% !important\r\n        }\r\n    }\r\n\r\n    @media (prefers-color-scheme: dark) {\r\n        body, .email-body, .email-body_inner, .email-content, .email-wrapper, .email-masthead, .email-footer {\r\n            background-color: #333 !important;\r\n            color: #FFF !important\r\n        }\r\n\r\n        p, ul, ol, blockquote, h1, h2, h3 {\r\n            color: #FFF !important\r\n        }\r\n\r\n        .attributes_content, .discount {\r\n            background-color: #222 !important\r\n        }\r\n\r\n        .email-masthead_name {\r\n            text-shadow: none !important\r\n        }\r\n    }     </style>\r\n<style type=\"text/css\">       .f-fallback {\r\n        font-family: Arial, sans-serif;\r\n    }     </style>     \r\n<span class=\"preheader\">Thanks for trying out <span contenteditable=\"false\">\'.$admin_site_name.\'</span>. Weï¿½ve pulled together some information and resources to help you get started.</span>\r\n<table class=\"email-wrapper\" width=\"100%\" cellpadding=\"0\" cellspacing=\"0\" role=\"presentation\" style=\"width: 100%;margin: 0;padding: 0;background-color: #F4F4F7;\">\r\n    <tbody><tr>\r\n        <td align=\"center\">\r\n            <table class=\"email-content\" width=\"100%\" cellpadding=\"0\" cellspacing=\"0\" role=\"presentation\">\r\n                <tbody><tr>\r\n                    <td class=\"email-masthead\" style=\"padding: 25px 0;text-align: center;\"><a href=\"\'.$webpage_full_link.\'\" class=\"f-fallback email-masthead_name\" style=\"font-size: 16px;font-weight: 700;color: #A8AAAF;text-decoration: none;text-shadow: 0 1px 0 #fff;\">\r\n                            <span contenteditable=\"false\">\'.$admin_site_name