e\">\' . $product_name . \'</span>             </span>\r\n                                                            </td>\r\n                                                        </tr>\r\n                                                        <tr>\r\n                                                            <td class=\"attributes_item\" style=\"line-height: 28px;\"><span class=\"f-fallback\">               <strong>Mobile Number :</strong> <span contenteditable=\"false\">\' . $listing_mobile . \'</span>             </span>\r\n                                                            </td>\r\n                                                        </tr>\r\n                                                        <tr>\r\n                                                            <td class=\"attributes_item\" style=\"line-height: 28px;\"><span class=\"f-fallback\">               <strong>Email Id :</strong> <span contenteditable=\"false\">\' . $email_id . \'</span>             </span>\r\n                                                            </td>\r\n                                                        </tr>\r\n                                                    </tbody></table>\r\n                                                </td>\r\n                                            </tr>\r\n                                        </tbody></table>\r\n                                        <p>You can login into your dashboard then you check all details of Product.</p>\r\n                                        <!-- Action -->\r\n                                        <table class=\"body-action\" align=\"center\" width=\"100%\" cellpadding=\"0\" cellspacing=\"0\" role=\"presentation\" style=\"width: 100%;margin: 30px auto;padding: 0;\">\r\n                                            <tbody><tr>\r\n                                                <td align=\"center\">\r\n                                                    <table width=\"100%\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" role=\"presentation\">\r\n                                                        <tbody><tr>\r\n                                                            <td align=\"center\"><a href=\"\'.$webpage_full_link_with_login.\'\" class=\"f-fallback button\" target=\"_blank\" style=\"background-color:#3869D4;border-top:10px solid #3869D4;border-right:18px solid #3869D4;border-bottom:10px solid #3869D4;border-left:18px solid #3869D4;display:inline-block;color:#FFF;text-decoration:none;border-radius:3px;box-shadow:0 2px 3px rgba(0,0,0,0.16);-webkit-text-size-adjust:none;box-sizing:border-box;\">Access\r\n                                                                    your dashboard</a></td>\r\n                                                        </tr>\r\n                                                    </tbody></table>\r\n                                                </td>\r\n                                            </tr>\r\n                                        </tbody></table>\r\n                                        <p>If you have any questions, feel free to <a href=\"mailto:{{support_email}}\">email\r\n                                                our customer success team</a>. (We\'re lightning quick at replying .)\r\n                                        </p>\r\n                                        <p> Thanks, <br> <span contenteditable=\"false\">\'.$admin_site_name.\'</span> Team</p>\r\n                                        <p><strong>P.S.</strong> Need immediate help getting started? Check out our <a href=\"\'.$webpage_full_link.\'\">help documentation</a>. Or, just reply to\r\n                                            this email, the <span contenteditable=\"false\">\'.$admin_site_name.\'</span> support team is always ready to help!\r\n                                        </p>                                         <!-- Sub copy -->\r\n                                        <table class=\"body-sub\" role=\"presentation\" style=\"margin-top: 25px;padding-top: 25px;border-top: 1px solid #EAEAEC;\">\r\n                                            <tbody><tr>\r\n                                                <td><p class=\"f-fallback sub\">If your having trouble with the button\r\n                                                        above, copy and paste the URL below into your web browser.</p>\r\n                                                    <p contenteditable=\"false\" class=\"f-fallback sub\">\'.$webpage_full_link.\'</p></td>\r\n                                            </tr>\r\n                                        </tbody></table>\r\n                                    </div>\r\n                                </td>\r\n                            </tr>\r\n                        </tbody></table>\r\n                    </td>\r\n                </tr>\r\n                <tr>\r\n                    <td>\r\n                        <table class=\"email-footer\" align=\"center\" width=\"570\" cellpadding=\"0\" cellspacing=\"0\" role=\"presentation\" style=\"width: 570px;margin: 0 auto;padding: 0;\">\r\n                            <tbody><tr>\r\n                                <td contenteditable=\"false\" class=\"content-cell\" align=\"center\" style=\"padding: 35px;\"><p class=\"f-fallback sub align-center\">Â© \r\n                                        \'.$admin_site_name.\'. All rights reserved.</p>\r\n                                    <p contenteditable=\"false\" class=\"f-fallback sub align-center\"> \'.$admin_site_name.\' <br>\'.$admin_address.\'\r\n                                    </p></td>\r\n                            </tr>\r\n                        </tbody></table>\r\n                    </td>\r\n                </tr>\r\n            </tbody></table>\r\n        </td>\r\n    </tr>\r\n</tbody></table>\r\n                    '),
