(9, 20, 4, 'Covid: Face mask rules and Covid passes to end in World', '<p>The prime minister also said the government would immediately drop its advice for people to work from home. The PM said England was reverting to &quot;Plan A&quot; due to boosters and how people had followed Plan B measures. He told MPs scientists believed the Omicron wave had peaked nationally. At a Downing Street press conference, Health Secretary Sajid Javid said: &quot;This is a moment we can all be proud of. &quot;It&#39;s a reminder of what this country can accomplish when we all work together.&quot; But, he said, this should not be seen as the &quot;finish line&quot; because the virus and future variants cannot be eradicated - instead &quot;we must learn to live with Covid in the same way we live with flu&quot;. He urged people to continue taking steps to keep the virus at bay, including hand washing, ventilating rooms and self-isolating if positive - and pressed those who were unvaccinated to come forward to get their jabs.</p>\r\n', '16302pexels-markus-spiske-3970332.jpg', 'Covid: Face mask rules and Covid passes to end in World', 'Covid: Face mask rules and Covid passes to end in World Covid: Face mask rules and Covid passes to end in World', 'covid, covid19, mask rules', 'Active', 'Covid  Face mask rules and Covid passes to end in World', '2022-01-22 20:26:14');
